import React from 'react';
//import {App} from './App.js'
import Background from './RestaurantSiteBG.jpg';

var App = require('./App.j');

var oContainer = {
    width: "100%",
    height: "400px",
    backgroundImage: `url(${Background})`
  };

class Container extends App {
render() {
    return (
    <section style={ oContainer }>
    </section>
    );
}
}

export default Container;
